script: |
  super -f text -I q12709.spq | sort > q12709.out

inputs:
  - name: q12709.spq
    data: |
      SELECT ALL + + ( 43 ) - ( + - 65 ) FROM tab1 (FORMAT parquet) WHERE + + ( - + col2 ) * - 60 + + col2 >= col2;
  - name: tab1

outputs:
  - name: q12709.out
    data: |
      108
      108
      108
